import React from "react";

const App = () => {
  return (
    <div style={styles.container}>
      {/* Header Section */}
      <header style={styles.header}>
        <h1 style={styles.title}>Pakistan Election Portal</h1>
        <nav style={styles.navbar}>
          <a href="" style={styles.navLink}>About</a>
          <a href="" style={styles.navLink}>Features</a>
          <a href="" style={styles.navLink}>Contact</a>
        </nav>
      </header>

      {/* Hero Section */}
      <section style={styles.hero}>
        <h2 style={styles.heroTitle}>Transparent & Secure Elections</h2>
        <p style={styles.heroText}>
          Conducting elections with integrity and trust. Your vote matters.
        </p>

        {/* Button Sections */}
        <div style={styles.buttonSections}>
          <div style={styles.buttonSection}>
            <img src="..\public\images\networking.png" alt="vote icon" style={styles.icon} />
            <p style={styles.sectionText}>Cast Your Vote</p>
            <button style={styles.button}>Cast Vote</button>
          </div>

          <div style={styles.buttonSection}>
            <img src="C:\Users\mtalh\Music\Voter-Pannel\pakistani-elections\frontend\my-app\public\images\polling.png" alt="results icon" style={styles.icon} />
            <p style={styles.sectionText}>View Election Results</p>
            <button style={styles.button}>View Results</button>
          </div>

          <div style={styles.buttonSection}>
            <img src="https://via.placeholder.com/50" alt="forum icon" style={styles.icon} />
            <p style={styles.sectionText}>View Discussion Forums</p>
            <button style={styles.button}>View Forums</button>
          </div>
        </div>
      </section>

      {/* Footer Section */}
      <footer style={styles.footer}>
        <p style={styles.footerText}>© 2024 Pakistan Election Portal. All rights reserved.</p>
        <p style={styles.footerText}>Made with care for democracy.</p>
      </footer>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: "Arial, sans-serif",
    color: "#1a2b2d",
    backgroundColor: "#ffffff",
    margin: 0,
    padding: 0,
    display: "flex",
    flexDirection: "column",
    minHeight: "100vh", // Ensures the container takes full viewport height
  },
  header: {
    backgroundColor: "#1a2b2d",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "20px",
  },
  title: {
    color: "#ffffff",
    fontSize: "24px",
    margin: 0,
  },
  navbar: {
    display: "flex",
    gap: "15px",
  },
  navLink: {
    color: "#ffffff",
    textDecoration: "none",
    fontSize: "16px",
  },
  hero: {
    textAlign: "center",
    padding: "100px 20px",
    backgroundColor: "#ffffff",
    flexGrow: 1, // This allows the hero section to grow and take available space
    display: "flex", // Center content
    flexDirection: "column", // Stack content vertically
    justifyContent: "center", // Vertically center content
    alignItems: "center", // Horizontally center content
  },
  heroTitle: {
    fontSize: "36px",
    marginBottom: "20px",
  },
  heroText: {
    fontSize: "18px",
    marginBottom: "30px",
    color: "#1a2b2d",
  },
  buttonSections: {
    display: "flex",
    justifyContent: "space-around",
    width: "100%",
  },
  buttonSection: {
    textAlign: "center",
    maxWidth: "250px",
    padding: "20px",
    backgroundColor: "#f5f5f5",
    borderRadius: "8px",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    margin: "10px",
  },
  icon: {
    width: "50px",
    height: "50px",
    marginBottom: "15px",
  },
  sectionText: {
    fontSize: "18px",
    marginBottom: "15px",
    color: "#1a2b2d",
  },
  button: {
    padding: "10px 20px",
    fontSize: "16px",
    backgroundColor: "#1a2b2d",
    color: "#ffffff",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
  },
  footer: {
    backgroundColor: "#1a2b2d",
    textAlign: "center",
    padding: "20px",
    color: "#ffffff",
    marginTop: "auto", // Ensures footer sticks to the bottom
  },
  footerText: {
    fontSize: "14px",
    margin: "5px 0",
  },
};

export default App;
